✨Jumping for joy. Pretty much sums up how you’d be feeling if you won one of the three trips that @backcountrylodgesofbc is offering for the winners of their #myBCbackcountry Through Your Lens Photo Contest. Imagine being flown into a remote lodge via helicopter, enjoying guided hikes, and catered meals each day. That’s just one of the 3 prizes being awarded this year.
⠀
I will be judging all of the photo submissions, but you can also enter a written submission on how you’ve made the backcountry a better place to be. Hurry, there is just over one week left to enter. Head to the link in my bio for all the contest details and share your favourite photos or story now.✨
⠀
